            $(""#page"").html(data);
        })
    }

    //修改客户信息
    function edit(id) {
        var url = '/Line/edit/' + id;
        $.get(url, function (data) {
            $(""#page"").html(data);
        })
    }

    //客户详情信息
    function detail(id) {
        var url = '/Line/detail/' + id;
        $.get(url, function (data) {
            $(""#page"").html(data);
        })
    }

    //删除客户信息
    function deletes(LineId) {
        var url = '/Line/delete/' + LineId;
        $.get(url, function (data) {
            $(""#page"").html(data);
        })
    }

</script>");
